			runOnlyForDeploymentPostprocessing = 0;
			shellPath = /bin/sh;
			shellScript = "#!/usr/bin/env bash\nset -euo pipefail\n\nREMOTE_URL=\"https://creator.osmand.net/basemap/regions.ocbf\"\nLOCAL_FILE=\"${SRCROOT}/Resources/Shipped/regions.ocbf\"\nTMP_FILE=\"$(mktemp \"${LOCAL_FILE}.download.XXXXXX\")\"\n\n# Ensure temp file is cleaned up no matter what\ntrap 'rm -f \"$TMP_FILE\"' EXIT\n\n# 1. If local missing → download unconditionally\nif [[ ! -f \"$LOCAL_FILE\" ]]; then\n  echo \"🔄 regions.ocbf missing → downloading fresh copy\"\n  curl --fail -R -S -o \"$TMP_FILE\" \"$REMOTE_URL\"\n  mv \"$TMP_FILE\" \"$LOCAL_FILE\"\n  exit 0\nfi\n\n# 2. Fetch remote headers once\nread -r REMOTE_SIZE REMOTE_DATE <<< $(\n  curl -sI \"$REMOTE_URL\" \\\n    | awk '\n        /^Content-Length:/   { size=$2 }\n        /^Last-Modified:/    { $1=\"\"; sub(/^ +/, \"\"); date=$0 }\n        END                  { print size, date }\n      ' \\\n    | tr -d '\\r'\n)\n\n# 3. Compare size\nLOCAL_SIZE=$(stat -f %z \"$LOCAL_FILE\")\nif [[ \"$LOCAL_SIZE\" -ne \"$REMOTE_SIZE\" ]]; then\n  echo \"🔄 Size changed: local=$LOCAL_SIZE remote=$REMOTE_SIZE → redownloading\"\n  curl --fail -R -S -o \"$TMP_FILE\" \"$REMOTE_URL\"\n  mv \"$TMP_FILE\" \"$LOCAL_FILE\"\n  exit 0\nfi\n\n# 4. Compare Last-Modified via conditional GET\nHTTP_CODE=$(\n  curl --silent --show-error --fail \\\n       -z \"$LOCAL_FILE\" \\\n       -w \"%{http_code}\" \\\n       -o \"$TMP_FILE\" \\\n       \"$REMOTE_URL\"\n)\n\ncase \"$HTTP_CODE\" in\n  200)\n    echo \"🔄 Server is newer (HTTP 200) → updated regions.ocbf\"\n    mv \"$TMP_FILE\" \"$LOCAL_FILE\"\n    ;;\n  304)\n    echo \"✅ regions.ocbf is already up to date (HTTP 304)\"\n    ;;\n  *)\n    echo \"⚠️ Unexpected HTTP $HTTP_CODE\" >&2\n    exit 1\n    ;;\nesac\n\n# Clean up the trap now that we're done\ntrap - EXIT\n";
		};
